import React, { Component } from 'react'
import './../css/cart.css'
import { mainapi } from '../api/API'
import { X } from '@phosphor-icons/react'
import { Link } from 'react-router-dom'
import { Userconsumer } from './CartContext'

export class Cart extends Component {

  render() {
    return (
      <Userconsumer>
        {
          (nn)=><p>{nn}</p>
        }
      </Userconsumer>
    )
  }
}

export default Cart
